import React, { useState } from "react";
import { CssVarsProvider, FormGroup, Switch } from "@mui/joy/styles";
import Button from "@mui/joy/Button";
import { FormControlLabel } from '@mui/material';


import Login from "./components/Login/Login";
import MainPage from "./components/MainPage/MainPage";

function App() {
  const [isLogin, setIsLogin] = useState(false);
  const [ID, setID] = useState("");

  const LoginHandler = () => {
    setIsLogin(true);
  };

  const IDHandler = (newID) => {
    setID(newID);
  };

  return (
    <React.Fragment>
      {!isLogin && <Login onLogin={LoginHandler} onID={IDHandler}></Login>}
      {isLogin && <MainPage id={ID}></MainPage>}
      <CssVarsProvider>
        <Button onClick={function () {}}>ssibal</Button>
        <FormGroup>
          <FormControlLabel control={<Switch defaultChecked />} label="Label" />
          <FormControlLabel disabled control={<Switch />} label="Disabled" />
        </FormGroup>
      </CssVarsProvider>
    </React.Fragment>
  );
}

export default App;
